- input: "TEXT\x1CC00010439\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's request for additional information dated May 29, 2013, as follows:
    \ 1.  There is no Schedule B  supporting Line  30 (b) item showing a payment for
    \"\"Absentee mailer.\"\"   2.  The Schedule H6 item supporting Line 30 ( a) payment
    for \"\"Absentee mailer\"\" did not mention any Federal candidate, but named the
    Democratic state candidates by state legislative district.  3.  The Idaho Democratic
    party is aware of the limitations on the use of monies received from the National
    Democratic Party and from other state or local parties.  The Idaho Democratic
    Party maintains an accounting system for the sources and uses of its funds to
    assure that the Federal component of Line 30(a) Federal Election Activity is paid
    for with other sources of funds, and that no funds transferred from the DNC or
    other party committees is used for the Federal portion of Line 30(a) funds.   4.
    \ The descriptions State ID and GOTV have been corrected on Schedules H6.  5.
    \ The totals on Schedule L Aggregation for the Levin Funds account are now correct,
    due to the amended Pre-General Election report filed.                                    All
    employee salaries, benefits, payroll taxes, insurance, and reimbursed expenses
    for employees who spend >25% of the month on Federal election activities are paid
    entirely with Federal funds and the expenses are reported on Line 30(b).  All
    other employee costs are shared Federal/Non Federal activities.\n"
